// extend wowslider for effect support
(function($) {
    var effects = "brick|collage|seven|photo|kenburns|cube|blur|book|rotate|domino|slices|blast".split("|");


    // create effects buttons
    // @callback = function(effect)
    function createEffects(effects, callback) {
        if (!$(".effbutton").length && $('#effbuttons').length) {
            var cont = $('#effbuttons');
            //wow.parent().append(cont);
            cont.html("<span class='effects-title'>Change effect: </span>");

            for (var e = 0; e < effects.length; e++)
                (function(effect) {
                    var a = $('<a class="button effbutton" href="#">' + effect.replace("_", " ") + '</a>');
                    cont.append(a);
                    a.data("effect", effect);
                    a.click(function() {
                        callback(effect);
                        return false;
                    });
                    cont.append(' ');
                })(effects[e]);
        }
    }

    function selectEffect(new_effect) {
        $(".effbutton").each(function() {
            $(this).css({
                'background-color': ($(this).data("effect") != new_effect) ? '' : '#63B4CA'
            });
        });
    };

    var cSlide, bkpCont, wowInstance;

    // rewrite slider
    // window.wowReInitor = function (wow,options){
    var default_wowSlider = $.fn.wowSlider;
    $.fn.wowSlider = function(options) {
        var wow = $(this);
        // add current effect if no in effects list
        if (options.effect && (effects.join("|").indexOf(options.effect) < 0))
            effects[effects.length] = options.effect;

        options.support = default_wowSlider.support;

        // change duration in brick effect
        if (options.effect == 'brick') options.duration = 5500;

        // recreate html or init effects
        if (!bkpCont) { //first start
            bkpCont = $(document.createElement("div")).append(wow.clone()).html();
            $(function() {
                createEffects(effects, function(eff) {
                    var new_o = $.extend({}, options);
                    new_o.effect = eff;
                    wowReInitor(wowInstance, new_o);
                    //reinitSlider(new_o);
                });

                selectEffect(options.effect);
            });
        } else {
            wow.get(0).wsStop();
            wow = $(bkpCont).replaceAll(wow);
        }

        wowInstance = wow; // save instance for effect

        if (!options.effect)
            options.effect = (effects[Math.floor(Math.random() * effects.length)]) || "blinds";
        var new_opt = $.extend({
            startSlide: cSlide,
            onStep: function(num) {
                cSlide = num
            }
        }, options);

        // run slider
        //var result = wow.wowSlider(new_opt); 
        var result = default_wowSlider.apply(wow, [new_opt]);

        if (isNaN(cSlide))
            cSlide = 0;
        else
            wow.get(0).wsStart(cSlide + 1);

        selectEffect(new_opt.effect);

        return result;
    }

    // for old compability
    window.wowReInitor = function(wow, options) {
        $(wow).wowSlider(options);
    };

})(jQuery);